import React from "react";

export default function App() {
  return (
    <React.Fragment>
      <div id="page1">
        <h1>Hello CodeSandbox</h1>
        <h2>Start editing to see some magic happen!</h2>
      </div>
      <div id="page2">
        <h1>Page 2</h1>
      </div>
      <div id="page3">
        <h1>Page 3</h1>
      </div>
    </React.Fragment>
  );
}
